import React, { useState } from 'react';
import { cloneDeep } from 'lodash';
import { Grid, Typography, Stack, Backdrop, Box } from '@mui/material';
import CloudDownloadIcon from '@mui/icons-material/CloudDownload';
import FavoriteBorderIcon from '@mui/icons-material/FavoriteBorder';
import FavoriteIcon from '@mui/icons-material/Favorite';
import MoreVertIcon from '@mui/icons-material/MoreVert';

const imagesMock = [
    {
        base64: '',
        id: '12a86dc3-ee39-41bf-bbdb-9f53605abc37',
    },
    {
        base64: '',
        id: 'd5c8a66d-6247-46ce-8bf7-4d7eb7f61a36',
    },
    {
        base64: '',
        id: 'b1604a00-2fac-4dc5-9be7-69f23a21c207',
    },
    {
        base64: '',
        id: '2b2c726c-822d-487a-8aa2-c8467f7ca8e4',
    },
];

function Images({ images, loading }) {
    const [overlayDisplay, setOverlayDisplay] = useState(-1);
    const [likedImages, setLikedImages] = useState([]);

    function downloadBase64File(base64Data, contentType, fileName) {
        const linkSource = `data:${contentType};base64,${base64Data}`;
        const downloadLink = document.createElement('a');
        downloadLink.href = linkSource;
        downloadLink.download = fileName;
        downloadLink.click();
    }

    function handleLikedImages(id) {
        const clonedArray = cloneDeep(likedImages);
        const index = clonedArray.indexOf(id);

        if (index !== -1) {
            clonedArray.splice(index, 1);
        } else {
            clonedArray.push(id);
        }
        setLikedImages(clonedArray);
    }

    if (loading) {
        return (
            <Stack my={{ lg: 8, xs: 2 }}>
                <Typography
                    variant="h6"
                    sx={{
                        fontFamily: 'Raleway',
                        color: '#ff624f',
                        fontWeight: 300,
                        fontSize: {
                            xs: '16px',
                            lg: '20px',
                        },
                        lineHeight: {
                            xs: '20px',
                            lg: '24px',
                        },
                    }}
                    mb={{ lg: 3, xs: 2 }}>
                    Processing
                </Typography>
                <Grid container>
                    {[1, 2, 3, 4, 5, 6, 7, 8].map((id) => (
                        <Grid
                            item
                            key={`image-processing-${id}`}
                            xs={12}
                            lg={6}>
                            <Box
                                sx={{
                                    width: '256px',
                                    maxWidth: '256px',
                                    height: '256px',
                                    background: '#ABA8A8',
                                    filter: 'drop-shadow(0px 4px 4px rgba(0, 0, 0, 0.25))',
                                    borderRadius: '8px',
                                }}
                                mb={3}
                            />
                        </Grid>
                    ))}
                </Grid>
            </Stack>
        );
    }

    return (
        <Grid direction="column" my={{ lg: 8, xs: 2 }}>
            <Typography
                variant="h6"
                sx={{
                    fontFamily: 'Raleway',
                    color: '#383838',
                    fontWeight: 300,
                    fontSize: {
                        xs: '16px',
                        lg: '20px',
                    },
                    lineHeight: {
                        xs: '20px',
                        lg: '24px',
                    },
                }}
                mb={{ lg: 3, xs: 2 }}>
                Generated in 5 seconds
            </Typography>
            <Grid item xs={12} container>
                {imagesMock.map((image) => (
                    <Grid
                        item
                        key={image.id}
                        height={{ lg: '256px' }}
                        width={{ lg: '256px' }}
                        sx={{
                            borderRadius: '8px',
                            filter: 'drop-shadow(0px 4px 4px rgba(0, 0, 0, 0.25))',
                            overflow: 'hidden',
                            position: 'relative',
                        }}
                        onMouseEnter={() => setOverlayDisplay(image.id)}
                        onMouseLeave={() => setOverlayDisplay(-1)}
                        mb={{ xs: 3 }}
                        mr={{ lg: 3 }}>
                        <img
                            height={256}
                            width={256}
                            src={`data:image/png;base64,${image.base64}`}
                            alt="art"
                            style={{ borderRadius: '8px' }}
                            onClick={() => setOverlayDisplay(image.id)}
                        />
                        {image.id === overlayDisplay ? (
                            <Backdrop
                                sx={{
                                    color: '#fff',
                                    zIndex: (theme) => theme.zIndex.drawer + 1,
                                    cursor: 'pointer',
                                    backgroundColor: 'rgba(60, 60, 60, 0.8)',
                                    padding: '24px',
                                }}
                                open={true}>
                                <Stack
                                    mt="auto"
                                    sx={{
                                        width: '100%',
                                    }}
                                    direction="row"
                                    justifyContent="space-between">
                                    <CloudDownloadIcon
                                        onClick={() =>
                                            downloadBase64File(
                                                image.base64,
                                                'image/png',
                                                'image.png',
                                            )
                                        }
                                    />
                                    {likedImages.includes(image.id) ? (
                                        <FavoriteIcon
                                            sx={{ color: '#ff624f' }}
                                            onClick={() =>
                                                handleLikedImages(image.id)
                                            }
                                        />
                                    ) : (
                                        <FavoriteBorderIcon
                                            onClick={() =>
                                                handleLikedImages(image.id)
                                            }
                                        />
                                    )}

                                    <MoreVertIcon />
                                </Stack>
                            </Backdrop>
                        ) : null}
                    </Grid>
                ))}
            </Grid>
        </Grid>
    );
}

export default Images;
